import React from 'react';

const Navbar = () => {
    return (
        <nav>
            <div>
                <a>CVA</a>
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/Begeleiding">Begeleiding</a></li>
                    <li><a href="/Professionals">Professionals</a></li>
                </ul>
            </div>
        </nav>
    )
}

export default Navbar;
